import React from "react";
import Header from "../Components/Header";
import Footer from "../Components/Footer";
import EnterAccount from "../Components/EnterAccount";

const Login = () => {
  return (
    <div className="Signin">
      <Header />
      <EnterAccount />
      <Footer />
    </div>
  );
};
export default Login;
